export const PostCard = ({title, body, id, cover}) => {


    return(
        
        <div className="post">
        <img src={cover} alt={title} />
        <div key={id} className="post-content">
            <h1>{title}</h1>
            <p>{body}</p>
        </div>
        </div>

    );
}
